import TextField from '@mui/material/TextField';
import { Button, Typography } from '@mui/material';
import TaskIcon from '@mui/icons-material/Task';
import { useNavigate, useLocation } from 'react-router-dom';
import React, { useState, useEffect } from "react";
import axios from "axios";
import { API_URL } from "../utils";




export const UpdateUserForm = () => {
    const location = useLocation();
    const { state } = location;
    const [currentUser, setCurrentUser] = useState(state);
    const navigate = useNavigate();
    console.log(currentUser)

    const [newUser, setNewUser] = useState(currentUser.OrgID);
  const [newFirst, setNewFirst] = useState(currentUser.firstName);
  const [newLast, setNewLast] = useState(currentUser.lastName);
  const [newEmail, setNewEmail] = useState(currentUser.email);
  const [isUpdated, setIsUpdated] = useState(false);

  const editUser = async () => {
    try {
      const response = await fetch(`${API_URL}/user`, {
        method: 'PATCH',
        headers: {
          'Content-Type': 'application/json',
          'Authorization': 'none'
        },
        body: JSON.stringify({
          UserID: currentUser.UserID,
          updateFirstVal: newFirst,
          updateLastVal: newLast,
          updateEmailVal: newEmail,
          updateOrgIDVal: newUser
        }),
        mode: 'cors'
      });
      setCurrentUser({
        UserID: currentUser.UserID,
        OrgID: newUser,
        firstName: newFirst,
        lastName: newLast,
        email: newEmail
      })
  
      const result = await response.json();
      setIsUpdated(true)
      console.log(result);
      console.log(JSON.stringify(currentUser));
      // Handle the response data here
    } catch (error) {
      console.error(error);
    }
  };

  useEffect(() => {
    console.log(currentUser);
    if (isUpdated) {
      navigate('/', { state: currentUser });
      setNewFirst("");
      setNewLast("");
      setNewEmail("");
      setNewUser("");
      setIsUpdated(false);
    }
  }, [isUpdated, currentUser]);

    return (
        <loginBody>
        <div className='rectangle'>
        <div class="logo-container">
        <img src="thatpivc.png" alt="WebWiz Logo" class="logo"/>
        <span class="logo-text">WEBWIZ</span>
        </div>
          <Typography align="left" variant="h6" paddingTop={2} paddingBottom={2}>
            Update your WebWiz™ account
          </Typography>
          <div className='addUserForm'>
          <TextField fullWidth size='small'
          id="outlined-basic"
          label="First Name"
          name='firstName'
          variant="outlined"
          value={newFirst}
          onChange={(e) => setNewFirst(e.target.value)} />
    <TextField fullWidth size='small'
          id="outlined-basic"
          label="Last Name"
          name='lastName'
          variant="outlined"
          value={newLast}
          onChange={(e) => setNewLast(e.target.value)} />
    </div>
    <div className='addUserForm'>
    <TextField fullWidth size='small'
          id="email"
          label="Email"
          variant="outlined"
          value={newEmail}
          onChange={(e) => setNewEmail(e.target.value)}
          name='email'/>
    </div>
    <div className='addUserForm'>
    <TextField fullWidth size='small'
          id="outlined-basic"
          label="Organization ID"
          variant="outlined"
          value={newUser}
          onChange={(e) => setNewUser(e.target.value)}
          name='OrgID'/>
          <Button size='big' disabled={!newUser || !newFirst || !newLast || !newEmail}
          variant='outlined' onClick={editUser}paddingTop={2}>
           <TaskIcon/>save
          </Button>
          </div>
          <div className='tinytext'>
          
          </div>
        </div>
        </loginBody>
      )
}
